import { useEffect, useState } from "react";
import "./widgetLg.css";
import axios from 'axios'

export default function WidgetLg() {
  const Button = ({ type }) => {
    return <button className={"widgetLgButton " + type}>{type}</button>;
  };
  const [newMovies, setNewMovies] = useState([]);

  useEffect(() => {
    const getNewMovies = async () => {
      try {
        const res = await axios.get("/movies?new=true", {
          headers: {
            token:
              "header eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjYxNmUzN2QwNzM2ZThkNGVkYmRkYWNmMiIsImlzQWRtaW4iOnRydWUsImlhdCI6MTYzNDkxNjU2NSwiZXhwIjoxNjM1MzQ4NTY1fQ.QWIB6_8z2xuuLvxOUIpvwfsiDZFVm4vWSiDcYPIHekQ",
          },
        });
        setNewMovies(res.data);
      } catch (error) {
        console.log(error);
      }
    };
    getNewMovies();
  }, []);
  return (
    <div className="widgetLg">
      <h3 className="widgetLgTitle">Latest Movies</h3>
      <table className="widgetLgTable">
        <tbody>
          <tr className="widgetLgTr">
            <th className="widgetLgTh">Name</th>
            <th className="widgetLgTh">Date</th>
            <th className="widgetLgTh">Duration</th>
            <th className="widgetLgTh">Genre</th>
          </tr>
          {newMovies.map(movie=>(

            <tr className="widgetLgTr">
            <td className="widgetLgUser">
              <img
                src={movie.img}
                alt=""
                className="widgetLgImg"
                />
              <span className="widgetLgName">{movie.title}</span>
            </td>
            <td className="widgetLgDate">{movie.createdAt}</td>
            <td className="widgetLgAmount">{movie.duration}</td>
            <td className="widgetLgStatus">
              <Button type="Declined" />
            </td>
          </tr>
                ))}
          
        </tbody>
      </table>
    </div>
  );
}
